function init(){setInterval(function(){TT.full()},1)}var TT={full:function(){var t=moment().format("HH"),n=parseInt(t,10),e=moment().format("mm"),r=parseInt(e,10),a=moment().format("ss"),o=3600*n+60*r+parseInt(a,10);o<=28800?ttMark="S":o>28800&&o<57600?ttMark="M":o>=57600&&(ttMark="R");var m=o%28800/28800,M=ttMark+":"+(Math.round(1e5*m)/1e5).toFixed(5),c=ttMark+":"+(Math.round(100*m)/100).toFixed(2);document.getElementById("clock5").innerHTML=M,document.getElementById("clock2").innerHTML=c}};